import React from 'react'
import './activeProj.css'
import ProjItem from "./porjItem/projItem";

const ActiveProj = props =>(

    <div className="projName">
        <select className="list1">
            <option>{props.projNames.map((name,index)=>{
            return(
                <ProjItem
                name={name}
                />
            )
            })}</option>

        </select>
    </div>
)

export default ActiveProj
